"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Pneumothorax (collapsed lung) (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/pneumothorax-collapsed-lung-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H7871920\">",
"      <span class=\"h1\">",
"       What is a pneumothorax?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A pneumothorax happens when air leaks out of the lung and collects in the space between the lung and the chest wall. This makes the lung collapse (",
"      <a class=\"graphic graphic_figure graphicRef64892 \" href=\"mobipreview.htm?25/40/26244\">",
"       figure 1",
"      </a>",
"      ).",
"     </p>",
"     <p>",
"      Other conditions can also cause a collapsed lung. But this article discusses a collapsed lung caused by air leaking out.",
"     </p>",
"     <p>",
"      A pneumothorax can be mild (a small collection of air) or severe (a large collection of air). A severe pneumothorax is a medical emergency and can be life-threatening.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7871935\">",
"      <span class=\"h1\">",
"       What causes a pneumothorax?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A lung injury, such as from an accident or surgery, can cause a pneumothorax.",
"     </p>",
"     <p>",
"      A pneumothorax can also happen in people who do not have a lung injury. Some lung conditions and behaviors make a pneumothorax more likely to happen. These include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Chronic obstructive pulmonary disease &ndash; This is a lung condition caused by smoking that makes it hard to breathe.",
"       </li>",
"       <li>",
"        Certain lung infections",
"       </li>",
"       <li>",
"        Cystic fibrosis &ndash; This is a condition that some children are born with. It causes lung damage and lung infections.",
"       </li>",
"       <li>",
"        Smoking",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Sometimes, a pneumothorax happens in people who have no known lung condition or injury.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7871950\">",
"      <span class=\"h1\">",
"       What are the symptoms of a pneumothorax?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with a small pneumothorax might not have any symptoms. They might find out that they have it when they have a chest X-ray for another reason.",
"     </p>",
"     <p>",
"      When people do have symptoms, the symptoms usually start suddenly and include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Chest pain that can be sharp or stabbing",
"       </li>",
"       <li>",
"        Trouble breathing",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7871965\">",
"      <span class=\"h1\">",
"       Should I call the doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. The symptoms listed above can also be caused by other conditions. But if you have these symptoms, call your doctor or nurse right away.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7871980\">",
"      <span class=\"h1\">",
"       Is there a test for a pneumothorax?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will ask about your symptoms, do an exam, and do a chest X-ray.",
"     </p>",
"     <p>",
"      He or she might also do a CT scan. A CT scan is an imaging test that can create pictures of the inside of the body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7871995\">",
"      <span class=\"h1\">",
"       How is a pneumothorax treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your treatment will depend on your symptoms and how small or big your pneumothorax is.",
"     </p>",
"     <p>",
"      If your pneumothorax is small, your doctor might treat you by giving you oxygen and following your condition. That&rsquo;s because a small pneumothorax sometimes gets better on its own. To follow your condition, your doctor might do a few chest X-rays over time.",
"     </p>",
"     <p>",
"      If your pneumothorax is large or causing symptoms, your doctor will remove the air that has collected outside of your lung. He or she can do this in different ways. It usually involves having your doctor make a small hole in between your ribs. He or she will put a tube through the hole and into the collection of air. The tube will stay in your chest for a few days.",
"     </p>",
"     <p>",
"      If your doctor uses a large tube (called a &ldquo;chest tube&rdquo;), you will need to stay in the hospital while it is in your chest. If your doctor uses a small tube, you might be able to go home during this time.",
"     </p>",
"     <p>",
"      If this procedure doesn&rsquo;t work, your doctor might need to do lung surgery to close off the air leak. This surgery is called &ldquo;thoracoscopy.&rdquo; During thoracoscopy, the doctor will give you medicine to make you sleep. Then he or she will make 2 or 3 small cuts between the ribs in your chest. He or she will put long, thin tools in these openings and into the space where the air collected. One of the tools has a camera on the end, which sends pictures to a TV screen. The doctor can look at the image on the screen to do the surgery.",
"     </p>",
"     <p>",
"      If you need thoracoscopy to treat your pneumothorax, your doctor might do another surgical procedure during thoracoscopy to help prevent a future pneumothorax. He or she might also do this procedure if your air leak stopped quickly, but you have had more than 1 pneumothorax.",
"     </p>",
"     <p>",
"      Another way to help prevent a future pneumothorax is for your doctor to put a substance in your chest tube. This substance goes into the space where the air collected and helps the lung stick to the chest wall. This helps prevent air from collecting again.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7872010\">",
"      <span class=\"h1\">",
"       What else should I do after treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you smoke, you should stop smoking. This can help lower your chance of getting another pneumothorax.",
"     </p>",
"     <p>",
"      You should also ask your doctor when you can fly in an airplane again. Some people need to wait a certain amount of time after treatment before it&rsquo;s safe for them to fly again.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H7872025\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
