"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?17/46/18146?source=see_link\">",
"       Patient information: Quitting smoking (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?33/16/34050?source=see_link\">",
"       Patient information: Going home from the hospital (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"mobipreview.htm?1/13/1236?source=see_link\">",
