"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <a class=\"nounderline abstract\" href=\"mobipreview.htm?39/30/40425/abstract/1\">",
"      Davies TF, Ando T, Lin RY, et al. Thyrotropin receptor-associated diseases: from adenomata to Graves disease. J Clin Invest 2005; 115:1972.",
"     </a>",
"    </li>",
