var title_f39_30_40428="OPTN classification for nodules in cirrhotic livers";
var content_f39_30_40428=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F87919&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F87919&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification system for nodules seen on images of cirrhotic livers from the Organ Procurement and Transplantation Network (OPTN)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"2\" width=\"50%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Class and description",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        OPTN class 0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Incomplete or technically inadequate study",
"       </td>",
"       <td>",
"        Repeat study required for adequate assessment; automatic priority MELD points cannot be assigned on basis of an imaging study categorized as OPTN class 0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        OPTN class 5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Meets radiologic criteria for HCC",
"       </td>",
"       <td>",
"        May qualify for automatic exception, depending on tumor&nbsp;stage*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Class 5A: &ge;1 cm and &lt;2 cm measured on late arterial or portal venous phase images",
"       </td>",
"       <td>",
"        Increased contrast enhancement in late hepatic arterial phase AND washout during later phases of contrast enhancement AND peripheral rim enhancement (capsule or pseudocapsule)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Class 5A-g: same size as OPTN class 5A HCC",
"       </td>",
"       <td>",
"        Increased contrast enhancement in late hepatic arterial phase AND growth by 50 percent or more documented on serial CT or MR images obtained &le;6 months apart",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Class 5B: maximum diameter &ge;2 cm and &le;5 cm",
"       </td>",
"       <td>",
"        Increased contrast enhancement in late hepatic arterial phase AND either washout during later contrast phases OR peripheral rim enhancement (capsule or pseudocapsule) OR growth by 50 percent or more documented on serial CT or MR images obtained &le;6 months apart (OPTN class 5B-g)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Class 5T: prior regional treatment for HCC",
"       </td>",
"       <td>",
"        Describes any residual lesion or perfusion defect at site of prior UNOS class 5 lesion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Class 5X: maximum diameter &ge;5 cm",
"       </td>",
"       <td>",
"        Increased contrast enhancement in late hepatic arterial phase AND either washout during later contrast phases OR peripheral rim enhancement (capsule or pseudocapsule)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Note: OPTN class number denotes whether an imaging examination is nondiagnostic (OPTN class 0) or the study includes an image that contains at least one treated or untreated HCC (OPTN class 5). OPTN class 5 is further subdivided by adding a capital letter to denote UNOS stage 1 disease (OPTN class 5A), UNOS stage 2 disease (OPTN class 5B), a treated HCC (OPTN class 5T), or HCC beyond acceptable size for transplantation (OPTN class 5X). The",
"    <em>",
"     g",
"    </em>",
"    in OPTN class 5A-g and OPTN class 5B-g is used to indicate that growth was used to arrive at the HCC diagnosis.",
"    <div class=\"footnotes\">",
"     CT: computed tomography; HCC: hepatocellular carcinoma; MELD: Model for End Stage Liver Disease scorre; MR: magnetic resonance; UNOS: United Network for Organ Sharing.",
"     <br>",
"      * As assessed according to the American Liver Tumor Study Group modification of the standard TNM staging system (stage II, T2N0M0).",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Wald C, Russo MW, Heimbach JK, et al. New OPTN/UNOS Policy for Liver Transplant Allocation: Standardization of Liver Imaging, Diagnosis, Classification, and Reporting of Hepatocellular Carcinoma. Radiology 2013; 266:376-382. Copyright &copy; 2013 Radiological Society of North America.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
